import Signup from "../Signup";
import { useNavigate } from "react-router-dom";
import signUpImage from "./signUpImage.jpg";
import classes from "./Signup.module.css";

const SignupBlock = () => {
  return (
    <div className={classes.sign_up}>
      <div>
        <h2>Join Meetup</h2>
        <p>
          People use Meetup to meet new people, learn new things, find support,
          get out of their comfort zones, and pursue their passions, together.
          Membership is free.
        </p>
        <button onClick={Signup} className={classes.btn_round}>
          Sign up
        </button>
      </div>
      <img src={signUpImage} alt="group" />
    </div>
  );
};
export default SignupBlock;
